DROP DATABASE IF EXISTS DADOS_TESTE_API;

CREATE DATABASE IF NOT EXISTS DADOS_TESTE_API;

CREATE TABLE DADOS_TESTE_API.projeto
(
    NAME VARCHAR(100),
    STATUS INT NOT NULL,
    ENABLED INT NOT NULL,
    VIEW_STATE INT NOT NULL,
    ACCESS_MIN INT NOT NULL,
    DESCRIPTION VARCHAR(240),
    CATEGORY_ID INT NOT NULL,
    INHERIT_GLOBAL INT NOT NULL,
    PRIMARY KEY (NAME)
);

CREATE TABLE DADOS_TESTE_API.usuario
(
    USERNAME VARCHAR(240),
    REALNAME VARCHAR(240),
    EMAIL VARCHAR(240),
    ENABLED INT NOT NULL,
    PROTECTED INT NOT NULL,
    ACCESS_LEVEL INT NOT NULL,
    COOKIE_STRING VARCHAR(100),
    PASSWORD VARCHAR(240),
    TIPO_CARGO VARCHAR(240),
    PRIMARY KEY (USERNAME)
);

CREATE TABLE DADOS_TESTE_API.json_body_request
(
    id int not null auto_increment primary key,
    nome_requisicao VARCHAR(240),
    request_body JSON
);

